import React from 'react';
import four from '../assets/Images/SWEET TOOTH X32.jpg'

function MenuFour(props) {
    return (
        <>
        
         <div className="container-fluid">
            <div className="row">
                <div className="col-sm-12">
                    <img src={four} className='img-fluid' alt="" />
                </div>
            </div>
         </div>   
    
        </>
    );
}

export default MenuFour;
